R/$SWIFTMODULE_DIR\n\n# Copy 'headers' related to mobile device\ncp -R $BUILD_DIR_DEVICE/include $RESULT_DIR/\n\n# Delete build directory\nrm -rf $PROJECT_DIR/build\n";
